import React, { PureComponent } from 'react';

export default class RestoPin extends PureComponent {
  render() {
    const { onClick } = this.props;

    return (
      <button
        type="button"
        onClick={onClick}
      >
        <img width="36px" height="40px" src="medias/icone-easylunch-orange.png" alt="icone" />
      </button>
    );
  }
}
